%pyspark

from __future__ import print_function

def depth(uri):
    return uri[:-1].count('/')

def length(uri):
    return len(uri) - uri.count('/')

def show_uri_pair(y):
    print(y[1], depth(y[0]), length(y[0]),  y[0])

ex = domain_records\
        .filter(lambda x: len(x[1]) > 10 and len(x[1]) < 100)\
        .takeSample(False, 10)

for dom in ex:
    print("------------------------------------")
    print("Domain:", dom[0])
    print("Crawled:", max([y[1] for y in dom[1]]))
    print("Pages:")
    for y in sorted(dom[1]): 
        show_uri_pair(y)

